import React from "react";
import Teams from "../Teams/Teams";
import Companies from "../compaines/Companies";
import ContactUs from "../ContactUs/ContactUs";
import { Services } from "../Services/Services";

function Main(props) {
  return (
    <main>
      <Services />
      <Teams />
      <Companies />
      <ContactUs />
    </main>
  );
}

export default Main;
